import React from 'react';
import ReactDOM from 'react-dom'; 

function CreatePostPage() {
  return (
    <div className="container py-4">
      <h2 className="mb-4 text-primary fw-bold">Create a New Travel Skill Post</h2>
      <p className="text-muted">This is where your form will go to add photos, videos, location, tags, and cost.</p>
    </div>
  );
}


export default CreatePostPage;
